#Nour Atef, Goutham Kukkadapu, Samah Y. Mohamed, Mariam Al Rashidi, Colin Banyon, Marco Mehl, Karl Alexander Heufer, Ehson F. Nasir, A. Alfazazi, Apurba K. Das, Charles K. Westbrook, William J. Pitz, Tianfeng Lu, Aamir Farooq, Chih-Jen Sung, Henry J. Curran, S. Mani Sarathy,
#A comprehensive iso-octane combustion model with improved thermochemistry and chemical kinetics,
#Combustion and Flame,
#Volume 178,
#2017,
#Pages 111-134,
#ISSN 0010-2180,
#https://doi.org/10.1016/j.combustflame.2016.12.029.
#(http://www.sciencedirect.com/science/article/pii/S0010218016304059)
#Abstract: Iso-Octane (2,2,4-trimethylpentane) is a primary reference fuel and an important component of gasoline fuels. Moreover, it is a key component used in surrogates to study the ignition and burning characteristics of gasoline fuels. This paper presents an updated chemical kinetic model for iso-octane combustion. Specifically, the thermodynamic data and reaction kinetics of iso-octane have been re-assessed based on new thermodynamic group values and recently evaluated rate coefficients from the literature. The adopted rate coefficients were either experimentally measured or determined by analogy to theoretically calculated values. Furthermore, new alternative isomerization pathways for peroxy-alkyl hydroperoxide (ȮOQOOH) radicals were added to the reaction mechanism. The updated kinetic model was compared against new ignition delay data measured in rapid compression machines (RCM) and a high-pressure shock tube. These experiments were conducted at pressures of 20 and 40 atm, at equivalence ratios of 0.4 and 1.0, and at temperatures in the range of 632–1060K. The updated model was further compared against shock tube ignition delay times, jet-stirred reactor oxidation speciation data, premixed laminar flame speeds, counterflow diffusion flame ignition, and shock tube pyrolysis speciation data available in the literature. Finally, the updated model was used to investigate the importance of alternative isomerization pathways in the low temperature oxidation of highly branched alkanes. When compared to available models in the literature, the present model represents the current state-of-the-art in fundamental thermochemistry and reaction kinetics of iso-octane; and thus provides the best prediction of wide ranging experimental data and fundamental insights into iso-octane combustion chemistry.
#Keywords: Iso-Octane; Combustion kinetics; Thermodynamics; Gauche; Alternative isomerisation
